import React from "react";
import "./Footer.css"

function Footer() {
  return (
    <div>
      <nav className="footernav">

        <div className="footernav1">
           Wallawaya Road,<br/>Pillewela,<br/>Buttala
        </div>
      </nav>
    </div>
  );
}

export default Footer;
